import { useEffect, useState } from "react";

function FriendList() {
    const [friends, setFriends] = useState([]);

    useEffect(() => {
        console.log(friends)
    }, [])

    return (
        <div>

            <h1>FRIENDLIST</h1>
            {friends.map(friend => (
                <div key={friend.id}>
                    {friend.name} -
                    {friend.email}
                </div>
            ))}
        </div>

    )
}

export default FriendList;
